INSERT INTO `article` VALUES ('1', null, null, 'wsdl文件生成WebService客户端代码', '<p>&nbsp; &nbsp; &nbsp; 有时候在项目中，一个项目可能有好几个公司在做。系统之间难免会出现互相调用接口的现象，这时候有一种办法就是使用webService。本篇文章将介绍如何将对接系统提供的WebService接口，根据对方提供的wsdl文件生成客户端代码， 下面我们一起来学习怎么通过wsdl2java命令生成客户端代码。</p>\n\n<h3>准备工作：</h3>\n\n<p>1、下载apache-cxf-3.2.7包，点击进入<a href=\"http://cxf.apache.org/download.html\" target=\"_blank\">官网下载地址</a>；</p>\n\n<p>2、配置环境变量：在环境变量中配置，CXF_HOME 值为apache-cxf-3.2.7地址。例如我的地址为D:\\install\\cxf\\apache-cxf-3.2.7；在PATH中加入%CXF_HOME%\\bin。</p>\n\n<h3>好了，进入正题：</h3>\n\n<p>1、首先，我们需要知道对接系统接口地址，用浏览器打开接口地址。</p>\n\n<p>2、将页面内容另存为.wsdl文件。</p>\n\n<p>3、打开cmd命令行，进入apache-cxf-3.2.7的bin目录下</p>\n\n<p>4、执行命令：wsdl2java -p com -d xxxx -client xxxxx.wsdl，执行完毕后，会在目标位置生成webservice的客户端代码。</p>\n\n<p>5、我们可以参考client类书写客户端调用代码。</p>\n\n<h3>参数解释：</h3>\n\n<p>&nbsp;(1)-p&nbsp; 指定其wsdl的命名空间，也就是要生成代码的包名；&nbsp; &nbsp; &nbsp; &nbsp;</p>\n\n<p>&nbsp;(2)-d&nbsp; 指定要产生代码所在目录 ；&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\n\n<p>&nbsp;(3)-client 生成客户端测试web service的代码 ；&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\n\n<p>&nbsp;(4)-server 生成服务器启动web&nbsp; service的代码 。</p>\n\n<h4>是不是很简单呢，动手试试吧。</h4>\n', 'html', null, null, '/attachment/20181202/57be891646fd40e49185365d5a4060be.jpg', null, '1', '0', 'normal', '1', '0', null, '151', '2018-12-02 10:44:13', '2018-12-02 22:53:18', null, null, null, null);
INSERT INTO `article` VALUES ('2', null, null, '大整数相加算法', '<p>不说了，直接上代码</p>\n\n<pre>\npackage com.learning;\n\npublic class bigDecimal {\n    public static void main(String[] args){\n        System.out.println(bigNumberSum(&quot;4267097523189999999999&quot; ,&quot;9548125312989777665443&quot;));\n    }\n\n    /**\n     * 大整数相加，利用数组存储\n     * 原理：利用竖式相加，对两个数进行反转，再按位相加，大于10进1，最终得到的结果再反转\n     * @param num1\n     * @param num2\n     * @return\n     */\n    private static String bigNumberSum(String num1,String num2){\n        //反转第一个数\n        char[] charsA = new StringBuffer(num1).reverse().toString().toCharArray();\n        //反转第二个数\n        char[] charsB = new StringBuffer(num2).reverse().toString().toCharArray();\n\n        //计算结果的长度为最长位数+1\n        int maxLen = charsA.length &gt; charsB.length ? charsA.length+1 : charsB.length+1;\n        int result[] = new int[maxLen];\n        /**\n         * 算法核心\n         */\n        for (int i=0;i 10){\n                temp = temp-10;\n                result[i+1]=1;\n            }\n            result[i]=temp;\n        }\n\n        /**\n         * 结果反转\n         */\n        StringBuilder sb = new StringBuilder();\n        for(int i = result.length-1;i &gt; 0;i--){\n            if(i==result.length-1 &amp;&amp; result[i] == 0){\n                continue;\n            }\n            sb.append(result[i]);\n        }\n        return sb.toString();\n    }\n}\n</pre>\n', 'html', null, null, '/attachment/20181202/6e6dce05468146e1bc26ce39954da5dc.jpg', null, '1', '0', 'normal', '1', '0', null, '45', '2018-12-02 12:58:32', '2018-12-02 19:24:54', null, null, null, null);
INSERT INTO `article` VALUES ('3', null, null, 'Git命令', '<h1>一、Git提交代码操作</h1>\n\n<h2>如果需要新建分支：</h2>\n\n<pre>\n 新建分支不切换：git branch [branch-name]\n 新建分支并切换：git checkout -b [branch-name]</pre>\n\n<h2>代码提交五步曲：</h2>\n\n<pre>\n 1、git status\n 2、git add xxx，或者全部添加（git add .）\n 3、git commit -m &quot;修复XXbug&quot;\n 4、git pull &lt;远程主机名&gt; &lt;远程分支名&gt;\n 5、git push &lt;远程主机名&gt; &lt;远程分支名&gt;\n\n<strong>注意</strong></pre>\n\n<p><em>&nbsp; git pull = git fetch + git merge</em>&nbsp;</p>\n\n<p><em>&nbsp; git merge [branch]</em></p>\n\n<p>&nbsp;</p>\n\n<h1>二、Git其他操作</h1>\n\n<h3>仓库</h3>\n\n<pre>\n# 在当前目录新建一个Git代码库\n$ git init\n# 新建一个目录，将其初始化为Git代码库\n$ git init [project-name]\n# 下载一个项目和它的整个代码历史\n$ git clone [url]</pre>\n\n<h3>配置</h3>\n\n<pre>\n# 在当前目录新建一个Git代码库\n$ git init\n# 新建一个目录，将其初始化为Git代码库\n$ git init [project-name]\n# 下载一个项目和它的整个代码历史\n$ git clone [url]</pre>\n\n<h3>增加/删除文件</h3>\n\n<pre>\n# 添加指定文件到暂存区\n$ git add [file1] [file2] ...\n# 添加指定目录到暂存区，包括子目录\n$ git add [dir]\n# 添加当前目录的所有文件到暂存区\n$ git add .\n# 添加每个变化前，都会要求确认\n# 对于同一个文件的多处变化，可以实现分次提交\n$ git add -p\n# 删除工作区文件，并且将这次删除放入暂存区\n$ git rm [file1] [file2] ...\n# 停止追踪指定文件，但该文件会保留在工作区\n$ git rm --cached [file]\n# 改名文件，并且将这个改名放入暂存区\n$ git mv [file-original] [file-renamed]</pre>\n\n<h3>代码提交</h3>\n\n<pre>\n# 提交暂存区到仓库区\n$ git commit -m [message]\n# 提交暂存区的指定文件到仓库区\n$ git commit [file1] [file2] ... -m [message]\n# 提交工作区自上次commit之后的变化，直接到仓库区\n$ git commit -a\n# 提交时显示所有diff信息\n$ git commit -v\n# 使用一次新的commit，替代上一次提交\n# 如果代码没有任何新变化，则用来改写上一次commit的提交信息\n$ git commit --amend -m [message]\n# 重做上一次commit，并包括指定文件的新变化\n$ git commit --amend [file1] [file2] ...</pre>\n\n<h3>分支</h3>\n\n<pre>\n# 列出所有本地分支\n$ git branch\n# 列出所有远程分支\n$ git branch -r\n# 列出所有本地分支和远程分支\n$ git branch -a\n# 新建一个分支，但依然停留在当前分支\n$ git branch [branch-name]\n# 新建一个分支，并切换到该分支\n$ git checkout -b [branch]\n# 新建一个分支，指向指定commit\n$ git branch [branch] [commit]\n# 新建一个分支，与指定的远程分支建立追踪关系\n$ git branch --track [branch] [remote-branch]\n# 切换到指定分支，并更新工作区\n$ git checkout [branch-name]\n# 切换到上一个分支\n$ git checkout -\n# 建立追踪关系，在现有分支与指定的远程分支之间\n$ git branch --set-upstream [branch] [remote-branch]\n# 合并指定分支到当前分支\n$ git merge [branch]\n# 选择一个commit，合并进当前分支\n$ git cherry-pick [commit]\n# 删除分支\n$ git branch -d [branch-name]\n# 删除远程分支\n$ git push origin --delete [branch-name]\n$ git branch -dr [remote/branch]</pre>\n\n<h3>标签</h3>\n\n<pre>\n# 列出所有tag\n$ git tag\n# 新建一个tag在当前commit\n$ git tag [tag]\n# 新建一个tag在指定commit\n$ git tag [tag] [commit]\n# 删除本地tag\n$ git tag -d [tag]\n# 删除远程tag\n$ git push origin :refs/tags/[tagName]\n# 查看tag信息\n$ git show [tag]\n# 提交指定tag\n$ git push [remote] [tag]\n# 提交所有tag\n$ git push [remote] --tags\n# 新建一个分支，指向某个tag\n$ git checkout -b [branch] [tag]</pre>\n\n<h3>查看信息</h3>\n\n<pre>\n# 显示有变更的文件\n$ git status\n# 显示当前分支的版本历史\n$ git log\n# 显示commit历史，以及每次commit发生变更的文件\n$ git log --stat\n# 搜索提交历史，根据关键词\n$ git log -S [keyword]\n# 显示某个commit之后的所有变动，每个commit占据一行\n$ git log [tag] HEAD --pretty=format:%s\n# 显示某个commit之后的所有变动，其&quot;提交说明&quot;必须符合搜索条件\n$ git log [tag] HEAD --grep feature\n# 显示某个文件的版本历史，包括文件改名\n$ git log --follow [file]\n$ git whatchanged [file]\n# 显示指定文件相关的每一次diff\n$ git log -p [file]\n# 显示过去5次提交\n$ git log -5 --pretty --oneline\n# 显示所有提交过的用户，按提交次数排序\n$ git shortlog -sn\n# 显示指定文件是什么人在什么时间修改过\n$ git blame [file]\n# 显示暂存区和工作区的差异\n$ git diff\n# 显示暂存区和上一个commit的差异\n$ git diff --cached [file]\n# 显示工作区与当前分支最新commit之间的差异\n$ git diff HEAD\n# 显示两次提交之间的差异\n$ git diff [first-branch]...[second-branch]\n# 显示今天你写了多少行代码\n$ git diff --shortstat &quot;@{0 day ago}&quot;\n# 显示某次提交的元数据和内容变化\n$ git show [commit]\n# 显示某次提交发生变化的文件\n$ git show --name-only [commit]\n# 显示某次提交时，某个文件的内容\n$ git show [commit]:[filename]\n# 显示当前分支的最近几次提交\n$ git reflog</pre>\n\n<h3>远程同步</h3>\n\n<pre>\n# 下载远程仓库的所有变动\n$ git fetch [remote]\n# 显示所有远程仓库\n$ git remote -v\n# 显示某个远程仓库的信息\n$ git remote show [remote]\n# 增加一个新的远程仓库，并命名\n$ git remote add [shortname] [url]\n# 取回远程仓库的变化，并与本地分支合并\n$ git pull [remote] [branch]\n# 上传本地指定分支到远程仓库\n$ git push [remote] [branch]\n# 强行推送当前分支到远程仓库，即使有冲突\n$ git push [remote] --force\n# 推送所有分支到远程仓库\n$ git push [remote] --all</pre>\n\n<h3>撤销</h3>\n\n<pre>\n# 恢复暂存区的指定文件到工作区\n$ git checkout [file]\n# 恢复某个commit的指定文件到暂存区和工作区\n$ git checkout [commit] [file]\n# 恢复暂存区的所有文件到工作区\n$ git checkout .\n# 重置暂存区的指定文件，与上一次commit保持一致，但工作区不变\n$ git reset [file]\n# 重置暂存区与工作区，与上一次commit保持一致\n$ git reset --hard\n# 重置当前分支的指针为指定commit，同时重置暂存区，但工作区不变\n$ git reset [commit]\n# 重置当前分支的HEAD为指定commit，同时重置暂存区和工作区，与指定commit一致\n$ git reset --hard [commit]\n# 重置当前HEAD为指定commit，但保持暂存区和工作区不变\n$ git reset --keep [commit]\n# 新建一个commit，用来撤销指定commit\n# 后者的所有变化都将被前者抵消，并且应用到当前分支\n$ git revert [commit]\n暂时将未提交的变化移除，稍后再移入\n$ git stash\n$ git stash pop</pre>\n\n<h3>其他</h3>\n\n<pre>\n# 生成一个可供发布的压缩包\n$ git archive</pre>\n', 'html', null, null, '/attachment/20181202/cf3b6e3629aa406c8f7a3cb47cbb8c52.png', null, '1', '0', 'normal', '1', '0', null, '58', '2018-12-02 13:39:55', '2018-12-02 19:24:20', null, null, null, null);
INSERT INTO `article` VALUES ('4', null, null, 'java List 等份截取', '<pre>\n/**\n     * 描述: 等份截取\n     * @author eyesmooon\n     * @param list\n     * @param size\n     * @return \n     * @date:2018年11月8日 下午8:00:36\n     */\n    public static  List&gt; subList(List list, int size) {\n        List&gt; lists = new ArrayList&gt;();\n        if (list != null &amp;&amp; size &gt; 0) {\n            int listSize = list.size();\n            if (listSize &lt;= size) {\n                lists.add(list);\n                return lists;\n            }\n            int batchSize = listSize / size;\n            int remain = listSize % size;\n            for (int i = 0; i &lt; batchSize; i++) {\n                int fromIndex = i * size;\n                int toIndex = fromIndex + size;\n                // System.out.println(&quot;fromIndex=&quot; + fromIndex + &quot;, toIndex=&quot; +\n                // toIndex);\n                lists.add(list.subList(fromIndex, toIndex));\n            }\n            if (remain &gt; 0) {\n                // System.out.println(&quot;fromIndex=&quot; + (listSize-remain) + &quot;,\n                lists.add(list.subList(listSize - remain, listSize));\n            }\n        }\n        return lists;\n    }\n</pre>\n', 'html', null, null, null, null, '1', '0', 'normal', '1', '1', null, '178', '2018-12-02 17:54:39', '2018-12-02 22:04:30', null, null, null, null);
